import React from 'react';

const Contact = () => {
    return (
        <div>
            <h1> Contact Us </h1>
                <div class="forms">
                    <label for="name"> First and last name: </label>
                    <input type="text" class= "form" placeholder="First and Last name"></input> <br></br>

                    <label for="name"> Message: </label>
                    <input type="text" class= "form" placeholder="Please write your message" width= "500" height ="1000"></input><br></br>
                    <button type="button" class= "searchbutton">SUBMIT </button>
                </div>
        </div>
        
    );
};

export default Contact;
